import React from "react";

interface IButton {
  value: string;
  className?: string;
  style?: React.CSSProperties;
  onClick?: () => void;
}

const starzButton = ({ value, className, style, onClick }: IButton) => (
  <button className={className} style={style} onClick={onClick}>
    {value}
  </button>
);

export default starzButton;
